INSERT INTO `content_types` (`id`, `position`, `parent`, `icon`, `image`, `name`, `title`, `description`, `active`) VALUES
(1, 4, 0, 'mdi mdi-feather', 'data:image/png;base64,', 'text', 'Тексты', '<p>Тексты популярных хитов, цитаты из классической литературы, лозунги лучших коучей, искрометные шутки стендап-комиков – все, что необходимо для текстового оформления Вашего продукта. Вы можете преобразовать арендованные тексты в необходимый для успешного продвижения формат. Удобный поиск позволит найти Вам материалы, способствующие росту продаж!</p>', 1);
INSERT INTO `content_types` (`id`, `position`, `parent`, `icon`, `image`, `name`, `title`, `description`, `active`) VALUES
(2, 2, 0, 'mdi mdi-filmstrip', 'data:image/png;base64,', 'video', 'Видео', '<p>Уникальные и качественные видео от профессиональных видеомейкеров. Динамичная и стильная картинка привлечет внимание к Вашему продукту, а трендовая съемка сделает продвижение более эффективным. Клипы, анимация, фильмы – здесь каждый найдет контент на свой вкус!</p>', 1);
INSERT INTO `content_types` (`id`, `position`, `parent`, `icon`, `image`, `name`, `title`, `description`, `active`) VALUES
(3, 1, 0, 'mdi mdi-image-outline', 'data:image/png;base64,', 'image', 'Изображения', '<p>Контент от топовых блогеров и фотографов, которые точно знают, что нужно аудитории. Фотографии и рисунки, способные украсить любой продукт и привлечь к нему внимание. Здесь каждый найдет изображения для создания фирменного стиля и успешного продвижения своей продукции.</p> \r\n<p>Удобный поиск позволит найти именно то, что полностью соответствует Вашим пожеланиям.</p>', 1);
INSERT INTO `content_types` (`id`, `position`, `parent`, `icon`, `image`, `name`, `title`, `description`, `active`) VALUES
(4, 3, 0, 'mdi mdi-waveform', 'data:image/png;base64,', 'audio', 'Аудио', '<p>Стильный бит и завораживающий вайб – то, что делает саундтреки, песни и рингтоны поистине уникальными. У каждого предпринимателя есть возможность подобрать уникальное аудио от известных исполнителей и лидеров радиочартов для эффективного продвижения.</p> \r\n<p>Найдите аудио, полностью соответствующее Вашим пожеланиям, и Ваш проект зазвучит с новой силой!</p>', 1);
INSERT INTO `content_types` (`id`, `position`, `parent`, `icon`, `image`, `name`, `title`, `description`, `active`) VALUES
(7, 5, 0, 'mdi mdi-registered-trademark', 'data:image/png;base64,', 'trademark', 'Товарные знаки', '<p>Логотипы и товарные знаки для создания фирменного и уникального оформления как у самых известных и модных компаний, лейблов и групп?</p>\r\n<p>Здесь Вы найдете все, чтобы Ваш бренд прогремел также громко!</p> \r\n<p>Если Вы еще не зарегистрировали свой товарный знак, то в целях экономии времени выбирайте его из предложенных на сервисе.</p>\r\n<p>Если Вы – владелец неиспользуемого товарного знака, то Вы можете поделиться им с другими и монетизировать свой контент.</p>', 1);
